content.css:
.visual {
  /*font-family: 'Segoe UI Semibold',wf_segoe-ui_semibold,helvetica,arial,sans-serif;*/
  font-family: 'Segoe UI', wf_segoe-ui_normal, helvetica, arial, sans-serif;
}
.visualControl .dBottomContainer .dSaveDialogContainer .dDialogContainer {
  min-width: 220px;
  min-height: 165px;
}
.visualControl .dBottomContainer .dSaveDialogContainer .dDialogContainer .dContent div {
  margin-top: 30px;
}
.visualControl .dBottomContainer .dSaveDialogContainer .dDialogContainer .dButtonsContainer {
  padding-bottom: 7px;
}
.control.dialog.dDeleteRecordDialog.open .dDialogContainer .dButtonsContainer {
  padding-bottom: 7px;
}
* ::-webkit-scrollbar {
  width: 10px;
  height: 10px;
  background-color: transparent;
}
* ::-webkit-scrollbar-thumb {
  background: #C8C8C8;
}
* ::-webkit-scrollbar-track-piece {
  background: 0 0;
}
input::-ms-clear {
  display: none;
}
.dContentContainer {
  flex: 1;
  display: flex;
  flex-direction: column;
  cursor: default;
  overflow: hidden;
  position: relative;
}
.dContentContainer .dContentContainer {
  flex: none;
  border: none;
}
.dContentContainer .control.dataList {
  padding: 2px;
}
.dContentContainer .control.tableEditor {
  display: flex;
  flex: 1;
  flex-direction: column;
  font-size: 16px;
  overflow: hidden;
}
.dContentContainer .control.tableEditor > .dBlocker {
  display: none;
  position: fixed;
  top: 0px;
  left: 0px;
  right: 0px;
  bottom: 0px;
  opacity: 0.3;
  background-color: gray;
  z-index: 1000;
}
.dContentContainer .control.tableEditor > .dBlockerText {
  display: none;
  position: fixed;
  top: 50%;
  left: 50%;
  transform: translateX(-50%);
  z-index: 2000;
  font-size: 20px;
  text-shadow: 4px 4px 2px #969696;
}
.dContentContainer .control.tableEditor > .dBottomContainer {
  flex: 1;
  display: flex;
  flex-direction: column;
  overflow: hidden;
}
.dContentContainer .control.tableEditor .control.table {
  flex: unset;
}
.dContentContainer .control.tableEditor .control.table > .table-row {
  min-height: 40px;
}
.dContentContainer .control.tableEditor .control.table > .table-row > .table-cell:not(.ql-editor) {
  white-space: nowrap;
}
.dContentContainer .control.tableEditor .control.table > .table-row > .table-cell {
  border-width: 1px;
}
.dContentContainer .control.tableEditor .control.table.htmlTable > .table-row > .table-cell > .dTextContainer {
  display: inline-block;
}
.dContentContainer .control.tableEditor .control.table.htmlTable > .table-row > .table-cell > .dSort {
  display: inline-block;
}
.dContentContainer .control.tableEditor.blockerVisible > .dBlocker {
  display: block;
}
.dContentContainer .control.tableEditor.blockerVisible > .dBlockerText {
  display: block;
}
.dContentContainer .control.tableEditor.blockerVisible > .dTopContainer {
  filter: blur(1px);
}
.dContentContainer .control.tableEditor.blockerVisible > .dBottomContainer {
  filter: blur(1px);
}
.dContentContainer .control.tableEditor.blockerVisible.hideContent > .dBottomContainer {
  visibility: hidden;
}
.dContentContainer .control.tableEditor.tableTransparent .control.table > .table-row > .table-cell {
  background-color: transparent;
}
.dContentContainer .control.tableEditor.borderHidden .control.table > .table-row > .table-cell {
  border: 0px;
}
.dContentContainer .control.textArea {
  display: flex;
}
.dContentContainer .control.textArea > textarea {
  border: 0px;
}
.dContentContainer .control.textArea.width-100percent {
  flex: 1;
}
.dContentContainer .control.textArea.width-100percent > textarea {
  flex: 1;
  width: 100%;
  /*padding: 0px;*/
}
.dContentContainer .control.button {
  display: flex;
  flex: 1;
}
.dContentContainer .control.button.width-100percent > button {
  flex: 1;
  width: 100%;
}
.dContentContainer .control.checkBox {
  text-align: left;
}
.dContentContainer .control.checkBox > input {
  width: auto;
}
.dContentContainer input {
  border: 1px solid #f3f3f3;
}
.dContentContainer select {
  border: 1px solid #f3f3f3;
}
.dContentContainer select,
.dContentContainer input,
.dContentContainer button,
.dContentContainer textarea {
  width: 200px;
  padding: 5px;
}
.dContentContainer textarea {
  resize: none;
}
.dContentContainer input::-webkit-outer-spin-button,
.dContentContainer input::-webkit-inner-spin-button {
  /* display: none; <- Crashes Chrome on hover */
  -webkit-appearance: none;
  margin: 0;
  /* <-- Apparently some margin are still there even though it's hidden */
}
.dContentContainer .wbMatrixButton {
  font-family: 'Segoe UI Semibold', wf_segoe-ui_semibold, helvetica, arial, sans-serif;
  background-image: none;
  box-shadow: none;
  background-color: #C8C8C8;
  padding: 6px 18px;
  border: 2px solid #C8C8C8;
  border-radius: 0;
  text-shadow: none;
  font-size: 14px;
  width: auto;
  line-height: 16px;
  white-space: nowrap;
  color: #000;
  transition: color 0.2s, background-color 0.2s, border-color 0.2s;
}
.dInfoMessage {
  display: inline-block;
  background-color: white;
  color: black;
  cursor: help;
  font-size: 14px;
}
.dInfoMessage:hover {
  background-color: lightgray;
}
.dVpServiceNotConnectedMessage {
  display: none;
  background-color: #f72f2f;
  border: 1px solid #f72f2f;
  border-radius: 5px;
  color: whitesmoke;
  padding: 1px 3px;
  z-index: 100;
}
.vpServiceNotConnected .dVpServiceNotConnectedMessage {
  display: block;
  position: absolute;
  right: 0;
  top: 0;
}
.teblocking {
  display: none;
  position: fixed;
  z-index: 99999;
  left: 0;
  top: 0;
  width: 100%;
  height: 100%;
  overflow: auto;
}
.teblocking > .teblocking-background {
  position: absolute;
  left: 0;
  top: 0;
  width: 100%;
  height: 100%;
  background-color: gray;
  opacity: 0.3;
}
.teblocking > .teblocking-content {
  background-color: white;
  margin: auto;
  padding: 50px 30px;
  border: 1px solid #888;
  width: 70%;
  border-radius: 5px;
  text-align: center;
  font-weight: bold;
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
}
.common-triangle-left::after {
  content: "\25C4";
}
.common-triangle-right::after {
  content: "\25BA";
}
.common-triangle-up::after {
  content: "\25B2";
}
.common-triangle-down::after {
  content: "\25BC";
}
.common-fadein-visible {
  opacity: 0;
  transition-property: opacity;
  display: block !important;
}
.common-fadein-visually-visible {
  opacity: 1;
}
.common-fadeout-hidden {
  display: none;
}
body {
  -ms-overflow-style: scrollbar;
}
.demxButton button {
  font-family: 'Segoe UI Semibold', wf_segoe-ui_semibold, helvetica, arial, sans-serif;
  background-image: none;
  box-shadow: none;
  background-color: #C8C8C8;
  padding: 0px 17px;
  border: 2px solid #C8C8C8;
  border-radius: 0;
  text-shadow: none;
  font-size: 14px;
  width: auto;
  white-space: nowrap;
  color: #000;
  transition: color 0.2s, background-color 0.2s, border-color 0.2s;
}
.demxButton:active:hover button,
.demxButton:focus button,
.demxButton:focus:hover button,
.demxButton:hover button {
  border-color: #000;
  background-color: #F4F4F4;
  color: #000;
  outline: 0;
}
.demxButton:active button {
  background-color: #666;
  border-color: #666;
  color: #000;
}
.demxButton.primary button {
  background-color: #F2C811;
  border-color: #F2C811;
  color: #000;
}
.demxButton.primary:active button,
.demxButton.primary:focus button,
.demxButton.primary:hover button {
  border-color: #000;
  color: #000;
}
.demxButton.primary:active:hover button,
.demxButton.primary:focus:hover button {
  background-color: #CDA521;
}
.demxButton.disabled button,
.demxButton.disabled.primary button,
.demxButton[disabled] button,
.demxButton[disabled].primary button {
  background-color: #F4F4F4;
  border-color: #F4F4F4;
  color: #A6A6A6;
  cursor: default;
}
.demxButton.disabled.primary:active button,
.demxButton.disabled.primary:focus button,
.demxButton.disabled.primary:hover button,
.demxButton.disabled:active button,
.demxButton.disabled:focus button,
.demxButton.disabled:hover button,
.demxButton[disabled].primary:active button,
.demxButton[disabled].primary:focus button,
.demxButton[disabled].primary:hover button,
.demxButton[disabled]:active button,
.demxButton[disabled]:focus button,
.demxButton[disabled]:hover button {
  background-color: #F4F4F4;
  border-color: #F4F4F4;
  color: #A6A6A6;
}
.common-image-btnClose {
  background-image: url(data:image/svg+xml;base64,);
}
.common-trashcan2 {
  width: 30px;
  height: 30px;
  background-image: url(data:image/png;base64,);
}
.control.button {
  display: flex;
  flex: 1;
  cursor: pointer;
  color: black !important;
}
.control.button > button {
  cursor: pointer;
  outline: none;
}
.control.button.width-100percent > button {
  flex: 1;
  width: 100%;
}
.control.button.disabled {
  cursor: default;
}
.control.button.disabled > button {
  cursor: default;
}
.control.checkBox {
  text-align: left;
}
.control.checkBox > input {
  width: auto;
}
.control.comboBox {
  display: flex;
}
.control.comboBox > select {
  outline: none;
}
.control.comboBox.width-100percent {
  flex: 1;
}
.control.comboBox.width-100percent > select {
  width: 100%;
}
.noBorder {
  border: none;
  outline: none;
}
.control.comboBox.android {
  height: 100%;
  justify-content: center;
  display: flex;
  flex-direction: column;
  background-color: white;
}
.control.comboBox.android .closed {
  display: none !important;
}
.control.comboBox.android .dropDownOption:hover {
  background-color: lightblue;
}
.control.comboBox.android .domElement.comboBox {
  display: flex;
  height: 100%;
}
.control.comboBox.android .domElement.comboBox .dropDownOpener {
  display: flex;
  width: 100%;
  height: 100%;
}
.control.comboBox.android .domElement.comboBox .dropDownOpener .selectedValue {
  height: 100%;
  display: flex;
  width: 100%;
  align-items: center;
  justify-content: flex-start;
}
